import React from 'react';
import '../App.css';

export function LocationFrame(props) {

    return (
        <div id={props.id} className='App-weatherComp'>
            <h3>{props.name}</h3>
            <img src={require(`./resources/WeatherIcons/${props.weather}.svg`)} alt='Weather icon' className='App-icons'/>
            <table style={{margin: 'auto', paddingBottom: 25}}>
                <td style={{paddingRight: 10}}>{props.temp} &deg;</td>
                <td style={{paddingLeft: 10}}>{props.wind} <div style={{fontSize: 10}}>m/s</div></td>
            </table>
        </div>
    )
}
